import { useEffect, useState } from "react"

const Data = () => {

    const [data, setData] = useState([])

    useEffect(() => {
        getData()
    }, [])

    async function getData() {

        const data = await fetch("http://localhost:3001/getUser", {
            method: "get",
            headers: {
                "Context-Text": "application/json"
            }
        })

        const json = await data.json()

        if (json.status) {
            setData(json.data)
        }

    }

    if (data.length === 0) return null


    return (
        <div>
            {
                data.map((user) => (
                    <div key={user._id}>
                        <div>Account Number -- {user.AccountNumber}</div>
                        <div>CustomerId -- {user.CustomerId}</div>
                        <div>MobileNumber -- {user.MobileNumber}</div>
                        <div>DOB -- {user.DOB}</div>
                        <div class="container">
                            <div id="contactData">
                                <ul id="list">
                                    <li>Account Number -- {user.AccountNumber}</li>
                                </ul>
                            </div>
                        </div>
                        <div class="container">
                            <div id="contactData">
                                <ul id="list">
                                    <li>CustomerId -- {user.CustomerId}</li>
                                </ul>
                            </div>
                        </div>
                        <div class="container">
                            <div id="contactData">
                                <ul id="list">
                                    <li>MobileNumber -- {user.MobileNumber}</li>
                                </ul>
                            </div>
                        </div>
                        <div class="container">
                            <div id="contactData">
                                <ul id="list">
                                    <li>DOB -- {user.DOB}</li>
                                </ul>
                            </div>
                        </div>
                    </div>

                ))
            }
        </div>
    )
}

export default Data
